import React from "react";
import { makeStyles, Typography, Card, CardContent, CardActions, Box } from "@material-ui/core";
import IconButton from "@material-ui/core/IconButton";
import Grid from "@material-ui/core/Grid";
import EditRoundedIcon from '@material-ui/icons/EditRounded';
import EqualizerRoundedIcon from '@material-ui/icons/EqualizerRounded';
import SendRoundedIcon from '@material-ui/icons/SendRounded';
import DeleteForeverRoundedIcon from '@material-ui/icons/DeleteForeverRounded';

import styles from "../styles/SurveyCardStyle";


const useStyles = makeStyles(styles);

function SurveyCard(props) {

  const classes = useStyles();


  const idTest="00000";
  const responseTest=8;
  const timeTest= new Date().toLocaleDateString();

  
  return (
    <React.Fragment>
      <Box width="100%">
      <Card className={classes.root} >
        <CardContent className={classes.content}>
          <Typography variant="h5">{props.name}</Typography>
          <div className={classes.details}>
            <Typography variant="subtitle2" className={classes.detailsItem}>
              ID: {props.id}
            </Typography>
            <Typography variant="subtitle2" className={classes.detailsItem}>
              Responses: {props.resNum}
            </Typography>
            <Typography variant="subtitle2" className={classes.detailsItem}>
              Date: {props.date}
            </Typography>
          </div>
        </CardContent>
        <CardActions className={classes.actions}>
          <IconButton aria-label="Edit" >
            <EditRoundedIcon />
          </IconButton>
          <IconButton aria-label="Analysis">
            <EqualizerRoundedIcon />
          </IconButton>
          <IconButton aria-label="Send">
            <SendRoundedIcon />
          </IconButton>
          <IconButton aria-label="Delete">
            <DeleteForeverRoundedIcon />
          </IconButton>
        </CardActions>
      </Card>
      </Box>
    </React.Fragment>
  )


}

export default SurveyCard;
